import { HamburgerIcon } from "@chakra-ui/icons";
import { Box, Flex, IconButton } from "@chakra-ui/react";

const Header = () => {
  return (
    <Flex w="100%" h="60px" bg="tomato" align="center" px={4}>
      <IconButton
        bg="none"
        aria-label="Menu"
        icon={<HamburgerIcon w="25px" h="25px" />}
      />
    </Flex>
  );
};

export default Header;
